window.bookSummaryJSON = "<p><i>The Tesseract Codex</i> is an epic tale of good versus evil set in a dystopian future with life in the outworlds hanging in the balance. The Tesseract Codex is an action adventure.... It is an alien mystery.... It is a love story.... It is funny and, at times, very human.... <i>The Tesseract Codex</i> is must-listen science fiction.&nbsp;&nbsp;</p> <p>John Korbin had lost everything, but he was an outworlder to the nines. He had survived the war. He had survived the loss of his wife and daughter and his whole family, but would he survive what followed?&nbsp;&nbsp;</p> <p>And then there was the <i>Tesseract</i>. It was a ship built with alien technology, but the mystery only began there. John should have known that when something looks too good to be true that it generally is, but he bought the <i>Tesseract </i>anyway. When he set foot upon its decks, he changed everything. Politicians had declared the war was over, but that was not at all true as John and the crew of the <i>Tesseract </i>were about to find out the hard way.&nbsp;&nbsp;</p> <p>Mission One takes John Korbin and the crew of the <i>Tesseract </i>into the heart of darkness to rescue Emma from the Mercenaries, but they would have to rescue Sophie first, if they were to succeed. Then Mission One brought John Korbin and the crew of the <i>Tesseract </i>face to face with old enemies from the war that wasn't really over. So, the <i>Tesseract </i>would have to survive in a crossfire hurricane that threatened John Korbin's new homeworld.&nbsp;</p> <p>If you enjoy a strongly character-driven story with lots of action, then you have to listen to<i> The Tesseract Codex</i>. This is real thrilling sci-fi that won't quit on your mind right down to the very last word.</p>"; 
